import React from 'react'
import './Navbar.css'
import logo from'../Assets/logo.png'
function Navbar() {
  return (
    <div className='navbar'>
      <div className='nav-logo'>
        <img src={logo} />
      </div>
    </div>
  )
}

export default Navbar
